Number.prototype.getMS=function(t){return 60*this*1e3},Number.prototype.addHour=function(t){var e=60*this*1e3;return t||(t=new Date),new Date(t.getTime()+e).getTime()},Number.prototype.AddZero=function(t,e){var r=String(t||10).length-String(this).length+1;return r>0?new Array(r).join(e||"0")+this:this};